import React, { Component } from 'react'

export default class PassOrder extends Component {
    goToAdress = (e) => {
        e.preventDefault();
        //console.log(this.state);
       
        this.props.history.push('/createOrder');
        console.log('btn',this.props);
    }
    render() {
        
        return (
            <div>
                 <Redirect to='/createorder' ></Redirect>


            </div>
        )
    }
}
